import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the 'My Events' link to be visible and click it
    await page.waitForSelector('a.nav-link[href="dashboard.html"]', { timeout: 5000 });
    await page.click('a.nav-link[href="dashboard.html"]');

    // Wait for the new page to load by waiting for a specific element on the dashboard
    await page.waitForSelector('.hero-title', { timeout: 5000 });

    // Take a screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_navigated_to_dashboard.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_navigated_to_dashboard.png'));

    // Extract meaningful data to verify task completion
    const pageTitle = await page.title();
    const userGreeting = await page.innerText('.hero-title');

    return {
      success: true,
      action: "Navigated to My Events page successfully.",
      extractedData: {
        pageTitle,
        userGreeting
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
